	return(
		<Container>
			<h1>College-to-career journey in 3 <span>SIMPLE</span> steps!</h1>
			<Scroll>
				<Journey1>
					<p>Step 1</p>
				</Journey1>
				<Journey2>
					<p>Step 2</p>
				</Journey2>
			</Scroll>
		</Container>	
	)
}

const Container = styled.div`
	position: absolute;
	width: 3632px;
	height: 798px;
