		font-size: 40px;
		line-height: 60px;
		text-align: center;

		color: #000000;
	}
	span{
		color: #4A66FB;
	}
`;

const Scroll = styled.div`
	height: 500px;
	position: relative;
	background-color: grey;
	top: 230px;
	left: 0px;
	width: 3632px;
	display: flex;
	overflow-x: auto;
	overflow-y: auto;

`;

const Journey1 = styled.div`
	p{
		position: absolute;
		width: 223px;
		height: 48px;
		left: 500px;
		top: 0px;

		font-family: 'Poppins', sans-serif;
		font-style: normal;
		font-weight: 600;
		font-size: 32px;
		line-height: 48px;
		/* identical to box height */
